import './App.css';
import Footer from './components/Footer';
import Nav from './components/Nav'
import { Outlet, Route, Routes } from 'react-router-dom';

const Layout = () => {
  return (
    <div>
      <Nav />

      <Outlet />

      <Footer />
    </div>
  )
}

function App() {
  return (
    <div className="app">
      <Routes>
        <Route path='/'>

        </Route>
      </Routes>
    </div>
  );
}

export default App;
